import React from "react";
import Articles from "../components/articles";
import Layout from "../components/layout";
import Seo from "../components/seo";
import { fetchAPI } from "../lib/api";
import SearchExampleStandard from "../components/search"
import LandingPage from "./Landing/landingpage"

const Home = ({ articles, categories, homepage, global, landingpage }) => {
  return (

    <div>
    <Layout categories={categories}>
      <Seo seo={homepage.seo} />
        <div className="uk-section">
        <div className="uk-container uk-container-large">
        <LandingPage></LandingPage>
        <div class="Peoplecontainer">
  <div class="PeopleCard">
    <h3 class="Peopletitle">Card 1</h3>
    <div class="bar">
      <div class="emptybar"></div>
      <div class="filledbar"></div>
    </div>
    <div class="circle">
      <svg version="1.1" xmlns="http://www.w3.org/2000/svg">
      <circle class="stroke" cx="60" cy="60" r="50"/>
    </svg>
    </div>
    </div>
    </div>
          <h1 className="Title">{homepage.hero.title}</h1>
          <Articles articles={articles} />
        </div>
      </div>
    </Layout>
  </div>
  );
};

export async function getStaticProps() {
  // Run API calls in parallel
  const [articles, categories, homepage, global, landingpage, writers] = await Promise.all([
    fetchAPI("/articles?status=published"),
    fetchAPI("/categories"),
    fetchAPI("/homepage"),
    fetchAPI("/global"),
    fetchAPI("/landing-page"),
    fetchAPI("/writers")

  ]);

  return {
    props: { articles, categories, homepage, global, landingpage, writers },
    revalidate: 1,
  };
}

export default Home;
